import React from 'react';
//@ts-ignore
import tshirtCover from "./assets/images/covers/t-shirt-business-name-ideas.png"
import tattooCover from "./assets/images/covers/set-of-y2k-tattoo-symbol-on-white-background-black-trendy-element-design-with-wing-butterflies-heart-pearl-fire-devil-90s-hand-drawn-tattoo-design-for-sticker-decorative-body-paint-vector.png";

export default function Home() {
    return (
        <>
            <div className='parallax'
                style={{
                    backgroundImage: `url(${tshirtCover})`
                }}
            >
                <button>T-shirts</button>
            </div>

            <div className='parallax'
                style={{
                    backgroundImage: `url(${tattooCover})`
                }}
            >
            <button>T-shirts</button>
        </div>
        </>


    );
}
